        'testCallVectorString' => Test\TestCallVectorString::class,
        'testCallVectorStringObject' => Test\TestCallVectorStringObject::class,
        'testSquareInt' => Test\TestSquareInt::class,
        'testNetwork' => Test\TestNetwork::class,
        'testProxy' => Test\TestProxy::class,
        'testGetDifference' => Test\TestGetDifference::class,
        'testUseUpdate' => Test\TestUseUpdate::class,
        'testReturnError' => Test\TestReturnError::class,
    ];

    public static function hasType(string $type): bool
    {
        return isset(static::TYPES[$type]);
    }

    public static function getTypeClass(string $type): string
    {
        if (!static::hasType($type)) {
            throw new InvalidArgumentException(
                sprintf('Type "%s" not found in registry', $type)
            );
        }

        return static::TYPES[$type];
    }

    public static function fromArray(array $array): TdObject
    {
        if (!isset($array['@type'])) {
            throw new InvalidArgumentException('Can\'t find "@type" key in array');
        }

        $type = $array['@type'];
        $extra = $array['@extra'] ?? null;
        $typeClass = static::getTypeClass($type);

        $obj = call_user_func($typeClass . '::fromArray', $array);

        return $obj->setTdExtra($extra);
    }
}
